import React from 'react'
import PropTypes from 'prop-types'
import {
  StyleSheet, Text, View, StatusBar, Dimensions
} from 'react-native'
import Button from 'components/Button'
import { colors } from 'theme'
import { LineChart} from "react-native-chart-kit";
//import {Card} from 'react-native-shadow-cards';


const labels = [
  'Jan',
  'Feb',
  'Mar',
  'Apr',
  'May',
  'Jun',
  ];
const data = [
  900000, 912000, 913000,917000,916000,921000
  ];
const data1 = [
  892000, 902000, 907000,915000,912000,918000
  ];



const styles = StyleSheet.create({
  root: {
    flex: 6,
    flexDirection: 'column',
    alignItems: 'left',
    justifyContent: 'flex-start',
    backgroundColor: colors.lightGrayPurple,
  },
  title: {
    fontSize: 24,
    marginTop: 20,
  },
  stitle: {
    fontSize: 12,
    color: '#a4a4a4',
    alignContent: 'left'
  }
})

const Home = ({ navigation }) => (
  <View style={styles.root}>
    <StatusBar barStyle="light-content" />
    <view style={{ justifyContent: 'flex-start', alignItems: 'left', marginLeft: 20}}>
    <Text style={styles.title}>6336 Culmore Cres.</Text>
    </view>
    <view style={{ justifyContent: 'flex-start', alignItems: 'left', marginLeft: 20}}>

    <Text style={styles.stitle}>Last Updated at 12/28/2020.</Text>
    </view>
    <view style={{flex: 1, flexDirection: 'row',justifyContent: 'center',fle, alignItems: 'stretch', marginLeft: 20, marginTop: 20}}>

    <Text style={{fontSize: 24, fontWeight: 'bold'}}>Propzi Price</Text>
    <View style={{alignSelf: 'flex-end', width: 80, height: 30, backgroundColor: 'powderblue'}} />
    </view>

    <View style={{alignItems: 'left', marginLeft: 0}}>
            <LineChart
              data={{
                labels: labels,
                datasets: [
                  {
                    data: data,
                  },
                  {
                    data: data1,
                  }
                ],
              }}
              width={Dimensions.get('window').width - 50} // from react-native
              height={220}
              chartConfig={{
                backgroundColor: '#fff',
                backgroundGradientFrom: '#fff',
                backgroundGradientTo: '#FFF',
                decimalPlaces: 0, // optional, defaults to 2dp
                color: (opacity = 0) => `rgba(0, 0, 0, ${opacity})`,
                labelColor: (opacity = 1) => `rgba(0, 0, 0, ${opacity})`,
                style: {
                  borderRadius: 16,
                },
                propsForDots: {
                  r: '6',
                  strokeWidth: '2',
                  stroke: '#35d1b9',
                },
                withDots: false
              }}
              //bezier
              style={{
                marginVertical: 5,
                borderRadius: 15,
              }}
            />
          </View>
    {/* <Button
      title="Go to Details"
      color="white"
      backgroundColor={colors.lightPurple}
      onPress={() => {
        navigation.navigate('Details', { from: 'Home' })
      }}
    /> */}
    {/* <View style={styles.container}>

      <Card style={{padding: 10, margin: 10, height: 50, backgroundColor: "#34d188", cornerRadius: 5, elevation: 3}}>
      <Text>Open up App.js to start working on your app!</Text>
      </Card>
    </View> */}

  </View>
)

Home.propTypes = {
  navigation: PropTypes.shape({
    navigate: PropTypes.func,
  }),
}

Home.defaultProps = {
  navigation: { navigate: () => null },
}

export default Home
